import '../style/Header.css'

function Contact() {
    return (
        <div> 
            <h1>Contact</h1>
            <div>
                <h4>If you just have a question or need to reach us. You can email us at <a href="mailto: info@mora-designs.com" style={{textDecoration: 'none',   fontStyle: 'italic'}}>info@mora-designs.com</a></h4>
                
                
            </div>
        </div>
    )
}

export default Contact;
